import React from 'react';
import { Link } from 'react-router-dom';
import '../home.css';

const Home = () => {
  return (
    <div className="homeContainer">
      <div className="homeImageContainer">
        <img src="https://domf5oio6qrcr.cloudfront.net/medialibrary/11499/3b360279-8b43-40f3-9b11-604749128187.jpg" alt="Login Image" />
      </div>
      <div className="welcome">
        SmartSlice Station
      </div>
      <div className="tabs">
        <Link to="/home" className="tab">Home</Link>
        <Link to="/foodlog" className="tab">Food Log</Link>
        <Link to="/tab3" className="tab">Nutritional Value</Link>
        <Link to="/tab4" className="tab">My Scale</Link>
        <Link to="/tab5" className="tab">My Profile</Link>
      </div>
    </div>
  );
};

export default Home;
